#include "cgamma.h"
#include "config.h"

// Parameters for Lanczos expansion.
// This should match the coefficients for initialization
// in function init_complex_gamma().

//#define LANCZOS_N 11
//#define LANCZOS_G 10.900511
//#define LANCZOS_N 17
//#define LANCZOS_G 12.2252227365970611572265625
//#define LANCZOS_N 24
//#define LANCZOS_G 20.3209821879863739013671875
//#define LANCZOS_N 42
//#define LANCZOS_G 43.1

// use 1024 bits
//#define LANCZOS_N 64
//#define LANCZOS_G 64.0

// use 1256 bits
#define LANCZOS_N 128
#define LANCZOS_G 120.0

// holds the coefficients for Lanczos approximation
mpfr_t lanczos_coeffs[LANCZOS_N];

int complex_lngamma(mpc_t rop, mpc_t op) {

        bool s = false;

        mpfr_t rez, imz, t;
        mpfr_init2(rez, MPBITS);
        mpfr_init2(imz, MPBITS);
        mpfr_init2(t, MPBITS);

        mpc_real(rez, op, MPC_RNDNN);
        mpc_imag(imz, op, MPC_RNDNN);

        if (mpfr_cmp_ui(rez, 0) < 0) { // if rez < 0

            mpfr_ui_sub(rez, 1, rez, MPFR_RNDN);
            mpfr_neg(imz, imz, MPFR_RNDN);
            s = true;

        }

        mpc_t z, res, Lg, x, y, w;
        mpc_init2(z, MPBITS);
        mpc_init2(res, MPBITS);
        mpc_init2(Lg, MPBITS);
        mpc_init2(x, MPBITS);
        mpc_init2(y, MPBITS);
        mpc_init2(w, MPBITS);

        mpfr_sub_ui(rez, rez, 1, MPFR_RNDN);
        mpc_set_fr_fr(z, rez, imz, MPC_RNDNN);
        mpc_set_fr(Lg, lanczos_coeffs[0], MPC_RNDNN);

        int i;
        for (i = 1; i < LANCZOS_N; i++) {

            mpc_set_fr(x, lanczos_coeffs[i], MPC_RNDNN);
            mpc_add_si(y, z, i, MPC_RNDNN);
            mpc_div(x, x, y, MPC_RNDNN);
            mpc_add(Lg, Lg, x, MPC_RNDNN);

        }

        mpc_set_ui(res, 0, MPC_RNDNN);

        mpc_log(w, Lg, MPC_RNDNN);
        mpc_add(res, res, w, MPC_RNDNN);

        mpfr_set_d(t, 0.5, MPFR_RNDN);
        mpc_add_fr(x, z, t, MPC_RNDNN);

        mpfr_set_d(t, LANCZOS_G, MPFR_RNDN);
        mpc_add_fr(y, x, t, MPC_RNDNN); // y = z + g + 0.5

        mpc_log(w, y, MPC_RNDNN);
        mpc_mul(w, x, w, MPC_RNDNN);

        mpc_add(res, res, w, MPC_RNDNN);
        mpc_sub(res, res, y, MPC_RNDNN);

        if (s) {

            mpc_neg(res, res, MPC_RNDNN);

            mpfr_const_pi(t, MPFR_RNDN);
            mpfr_log(t, t, MPFR_RNDN);
            mpc_add_fr(res, res, t, MPC_RNDNN);

            mpfr_const_pi(t, MPFR_RNDN);
            mpc_mul_fr(y, z, t, MPC_RNDNN);
            mpc_sin(y, y, MPC_RNDNN);
            mpc_neg(y, y, MPC_RNDNN);
            mpc_log(y, y, MPC_RNDNN);
            mpc_sub(res, res, y, MPC_RNDNN);

        }

        int rcod;
        rcod = mpc_set(rop, res, MPC_RNDNN);

        // clear variables
        mpfr_clear(rez);
        mpfr_clear(imz);
        mpfr_clear(t);

        mpc_clear(z);
        mpc_clear(res);
        mpc_clear(Lg);
        mpc_clear(x);
        mpc_clear(y);
        mpc_clear(w);

        return rcod;

}

